import React ,{useState} from "react";

export default function Hoo() {

  let [Info,setInfo]=useState({
    Name:"Manpreet",
    College:'amity University Madhya Pradesh ',
    Age:'20',
    Hobby:'Badminton'
  })
  return (
    <div>

      <p> Name: {Info.Name}</p>
      <p> School:{Info.School}</p>
      <p> Age:{Info.Age}</p>
      <p> Hobby:{Info.Hobby}</p>


      <button onClick={()=>{
       if(Info.Name==='Manpreey') 
       {setInfo({
          Name:'Subodh',
          School:'Gurukul',
          Age:'20',
          Hobby:'Cricket'
        })}
        else{
          setInfo({
            Name:'Samarth',
            School:'Convent School',
            Age:'9',
            Hobby:'Football'
          })
        }

      }}>Click Me</button>
    </div>
  );
}
